import { makeStyles } from "@mui/styles"


export const useStyles = makeStyles({
  logo:{
    color:"black",
  },
  header:{
    textAlign:'left',
    backgroundColor:'#fffff',
    boxShadow:'none'
  },
  itemMenu:{
    fontSize:'2em',
    color:'black',
  },
  menu:{
    display:'flex',
    marginLeft:'20px',
    width:'20%',
    justifyContent:'space-between'
  }
})
